        "text":
            "–ü–∏—à–µ—Ç –î–æ–Ω–µ—Ü–∫–∏–π - –®–∞–ª–∞–Ω–¥—ã –ø–æ–ª–Ω—ã–µ —á–µ–≥–æ —Ç–æ –≤ –û–¥–µ—Å—Å—É –ù–ê–¢–û –ø—Ä–∏–≤–æ–¥–∏–ª \n \n–í –ø—Ä–∞–∑–¥–Ω–∏–∫ –ø—Ä–∏—Ö–æ–¥–∏—Ç—Å—è –æ –≤–æ–π–Ω–µ, –Ω–æ —Å –¥—Ä—É–≥–æ–π —Ç–æ —Å—Ç–æ—Ä–æ–Ω—ã –¥–µ–Ω—å –ü–æ–±–µ–¥—ã –Ω–∞—à–µ–≥–æ –ø–æ–∫–æ–ª–µ–Ω–∏—è –µ—â–µ –Ω–µ –ø—Ä–∏—à–µ–ª. –ò—Ç–∞–∫, –±–æ–µ–≤—ã–µ —É—á–∞—Å—Ç–∫–∏, –¥–æ —Ñ—Ä–æ–Ω—Ç–æ–≤ –ø–æ–∫–∞ –Ω–µ –¥–æ—Ç—è–≥–∏–≤–∞–µ—Ç: \n \n1. –û–¥–µ—Å—Å–∫–∏–π. –°–ø—É—Å—Ç—è 81 –≥–æ–¥ –∏—Å—Ç–æ—Ä–∏—è –ø–æ–≤—Ç–æ—Ä—è–µ—Ç—Å—è. –¢–æ–ª—å–∫–æ —Ç–æ–≥–¥–∞ –±—ã–ª–∞ –ö–æ–Ω—Å—Ç–∞–Ω—Ü–∞ –∫–∞–∫ –ª–æ–≥–∏—Å—Ç–∏—á–µ—Å–∫–∏–π —É–∑–µ–ª –í–µ—Ä–º–∞—Ö—Ç–∞, —Ç–µ–ø–µ—Ä—å –û–¥–µ—Å—Å–∞ –∫–∞–∫ –ª–æ–≥–∏—Å—Ç–∏—á–µ—Å–∫–∏–π —É–∑–µ–ª –£–ì–ò–õ. –î–∞–∂–µ –∫–æ—Ä–∞–±–ª—å –ø–æ–¥ –Ω–∞–∑–≤–∞–Ω–∏–µ–º \"–ú–æ—Å–∫–≤–∞\" –ø–æ–≥–∏–±, —Ç–æ–≥–¥–∞ –ª–∏–¥–µ—Ä, —Å–µ–π—á–∞—Å –∫—Ä–µ–π—Å–µ—Ä. –ß—Ç–æ –ø—Ä–æ–∏—Å—Ö–æ–¥–∏—Ç? –ê –ø—Ä–æ–∏—Å—Ö–æ–¥–∏—Ç —Å–ª–µ–¥—É—é—â–µ–µ - –≤ –ø–µ—Ä–≤—ã–µ –¥–Ω–∏ –°–í–û –∑–∞—Ö–≤–∞—Ç–∏–≤ –ó–º–µ–∏–Ω—ã–π (–±–æ–ª—å—à–µ —Å–∫–∞–ª—É —á–µ–º –æ—Å—Ç—Ä–æ–≤) –∏ —É—Å—Ç–∞–Ω–æ–≤–∏–≤ –∫–æ–Ω—Ç—Ä–æ–ª—å –Ω–∞–¥ –∞–∫–≤–∞—Ç–æ—Ä–∏–µ–π –ö–ß–§ –ø–æ–ª–Ω–æ—Å—Ç—å—é –±–ª–æ–∫–∏—Ä–æ–≤–∞–ª –û–¥–µ—Å—Å—É —Å –≤–æ–∑–¥—É—Ö–∞, –º–æ—Ä—è –∏ —Å–æ–∑–¥–∞–ª —É–≥—Ä–æ–∑—É –¥–µ—Å–∞–Ω—Ç–∞, –æ—Ç–≤–ª–µ–∫–∞—è –±–æ–ª—å—à–∏–µ —Å–∏–ª—ã –í–°–£. \n \n–ì–∏–±–µ–ª—å –∂–µ \"–ú–æ—Å–∫–≤—ã\" –ø–æ–∫–∞–∑–∞–ª–∞ –ø—Ä–æ—Å—Ç—É—é –≤–µ—â—å - –±–µ–∑ –∫–æ—Ä–∞–±–ª–µ–π —Å —Ç—è–∂–µ–ª—ã–º–∏ –∏ –¥–∞–ª—å–Ω–æ–±–æ–π–Ω—ã–º–∏ –ó–†–ö —Ç–∞–∫–∞—è –±–ª–æ–∫–∞–¥–∞ –Ω–µ–≤–æ–∑–º–æ–∂–Ω–∞. –ê —Ç–∞–∫–æ–π –∫–æ—Ä–∞–±–ª—å –±—ã–ª –æ–¥–∏–Ω. –ù–µ–º–æ–¥–µ—Ä–Ω–∏–∑–∏—Ä–æ–≤–∞–Ω–Ω—ã–π –∏ —É—Å—Ç–∞—Ä–µ–≤—à–∏–π. –î–∞–∂–µ —Ñ—Ä–µ–≥–∞—Ç—ã –Ω–µ—Å—É—Ç –º–æ—Ä—Å–∫–æ–π –∞–Ω–∞–ª–æ–≥ –ë—É–∫–∞, –∞ —ç—Ç–æ —Å–æ–≤—Å–µ–º –Ω–µ —Ç–æ. –í –∏—Ç–æ–≥–µ –∂–µ –ó–º–µ–∏–Ω—ã–π –æ–∫–∞–∑–∞–ª—Å—è –ø–æ–¥ —É–¥–∞—Ä–æ–º. –ü—Ä–æ—Ç–∏–≤–Ω–∏–∫ —ç—Ç–∏ —É–¥–∞—Ä—ã —Å –ø–æ–º–æ—â—å—é –ë–ü–õ–ê –∏ –Ω–∞—á–∞–ª –Ω–∞–Ω–æ—Å–∏—Ç—å. –ú—ã –ø–æ—Ç–µ—Ä—è–ª–∏ (–ø—Ä–µ–¥–ø–æ–ª–æ–∂–∏—Ç–µ–ª—å–Ω–æ) –Ω–µ—Å–∫–æ–ª—å–∫–æ (2-3) –º–∞–ª—ã—Ö –∫–∞—Ç–µ—Ä–∞ –∏ –ó–†–ö –∏ —Ä–µ—à–∏–ª–∏ —ç–≤–∞–∫—É–∏—Ä–æ–≤–∞—Ç—å –≥–∞—Ä–Ω–∏–∑–æ–Ω, –∫–æ—Ç–æ—Ä—ã–π –æ–∫–∞–∑–∞–ª—Å—è –±–µ–∑ –ø—Ä–∏–∫—Ä—ã—Ç–∏—è. –ü—Ä–∏ —ç–≤–∞–∫—É–∞—Ü–∏–∏ –ø–æ–≥–∏–± –≤–µ—Ä—Ç–æ–ª–µ—Ç. –ü–æ—Å–ª–µ —á–µ–≥–æ —Ö–æ—Ö–ª—ã –ø–æ–ø–µ—Ä–ª–∏ –ø–æ–¥–Ω–∏–º–∞—Ç—å –ø—Ä–∞–ø–æ—Ä –∏ –ø–æ—Ç–µ—Ä—è–ª–∏ –∫–∞—Ç–µ—Ä, –¥–≤–∞ —Å–∞–º–æ–ª–µ—Ç–∞, –Ω–µ—Å–∫–æ–ª—å–∫–æ –≤–µ—Ä—Ç–æ–ª–µ—Ç–æ–≤. –°—Ç—Ä–æ–µ–Ω–∏—è –Ω–∞ –æ—Å—Ç—Ä–æ–≤–µ —É–Ω–∏—á—Ç–æ–∂–µ–Ω—ã. –û—Å—Ç—Ä–æ–≤ –Ω–∏—á–µ–π. \n \n–õ–∏—à–Ω–∏–π —Ä–∞–∑ –¥–æ–∫–∞–∑–∞–Ω–æ - –±–µ–∑ —Ç—è–∂–µ–ª—ã—Ö –∫–æ—Ä–∞–±–ª–µ–π —Å —Å–æ–≤—Ä–µ–º–µ–Ω–Ω–æ–π –ü–í–û —Ç–∞–∫–æ–≥–æ —Ä–æ–¥–∞ –æ–ø–µ—Ä–∞—Ü–∏–∏ –Ω–µ–≤–æ–∑–º–æ–∂–Ω—ã. –§—Ä–µ–≥–∞—Ç–æ–≤ –¥–ª—è –Ω–∏—Ö –º–∞–ª–æ. –¢—è–∂–µ–ª—ã—Ö –∫–æ—Ä–∞–±–ª–µ–π –Ω–∞ –ö–ß–§ –Ω–µ—Ç. –û–¥–µ—Å—Å—É —Ö–æ—Ä–æ—à–æ –ø–æ—Ä–∞–≤–Ω—è–ª–∏ —Ä–∞–∫–µ—Ç–∞–º–∏, –Ω–µ—Å–∫–æ–ª—å–∫–æ –¥–µ—Å—è—Ç–∫–æ–≤ –ø—Ä–∏–ª–µ—Ç–æ–≤, –Ω–æ —ç—Ç–æ –ø—Ä–æ–±–ª–µ–º—É –Ω–µ —Ä–µ—à–∞–µ—Ç. –ï–µ –º–æ–∂–µ—Ç —Ä–µ—à–∏—Ç—å —Ç–æ–ª—å–∫–æ –≤–∑—è—Ç–∏–µ –≥–æ—Ä–æ–¥–∞, –∏–ª–∏ –≤—ã—Ö–æ–¥ –Ω–∞ –µ–≥–æ –æ–∫—Ä–∞–∏–Ω—ã —Å–æ —Å—Ç–∏—Ä–∞–Ω–∏–µ–º –†–°–ó–û –∏ –∞—Ä—Ç–∏–ª–ª–µ—Ä–∏–µ–π –≤—Å–µ—Ö –æ–±—ä–µ–∫—Ç–æ–≤ –≤–æ–µ–Ω–Ω–æ–π –∏ –ø–æ—Ä—Ç–æ–≤–æ–π –∏–Ω—Ñ—Ä–∞—Å—Ç—Ä—É–∫—Ç—É—Ä—ã. \n \n2. –î–æ–Ω–±–∞—Å—Å–∫–∏–π. –°–µ–≤–µ—Ä–æ–¥–æ–Ω–µ—Ü–∫–∏–π –∫–æ—Ç–µ–ª –ø—Ä–µ–≤—Ä–∞—â–∞–µ—Ç—Å—è –≤ —Ä–µ–∞–ª—å–Ω–æ—Å—Ç—å. –ï—â–µ –æ–¥–Ω–æ —É—Å–∏–ª–∏–µ, –∏ –ø–æ–º–∏–º–æ –≤–æ—é—â–µ–≥–æ –æ —Ä–µ–∞–ª–∏—Ç–∏-—à–æ—É –¥—Ä—É–∂–µ –í–æ–ª—ã–Ω—ã –ø–æ–ª—É—á–∏–º –µ—â–µ –æ–¥–Ω–æ–≥–æ –≤–æ—é—â–µ–≥–æ –¥—Ä—É–∂–µ –°–º–µ—Ä–µ–∫—É –∏–ª–∏ —Ç–∞–º –î—É–±–∞ –Ω–∞ —Ç–µ—Ä—Ä–∏—Ç–æ—Ä–∏–∏ –æ–¥–Ω–æ–≥–æ –∏–∑ –∑–∞–≤–æ–¥–æ–≤, —Å–∫–æ—Ä–µ–µ –≤—Å–µ–≥–æ –õ–∏—Å–∏—á–∞–Ω—Å–∫–æ–≥–æ –ù–ü–ó. –Æ–∂–Ω–µ–µ –ø—Ä–æ—Ç–∏–≤–Ω–∏–∫, –ø–æ–¥–≤–µ–∑—è –º—è—Å–æ, –∞—Ç–∞–∫–æ–≤–∞–ª –≤ —Ä–∞–π–æ–Ω–µ –£–≥–ª–µ–¥–∞—Ä–∞. –°–µ–ª–æ –ü–∞–≤–ª–æ–≤–∫–∞ –ø–æ–¥ –Ω–µ–ø–æ–¥—Ç–≤–µ—Ä–∂–¥–µ–Ω–Ω—ã–º –¥–∞–Ω–Ω—ã–º –¥–∞–∂–µ –∑–∞–Ω—è–ª...–Ω–∞ –ø–∞—Ä—É —á–∞—Å–æ–≤. –ë—ã–ª –≤—ã–±–∏—Ç. –ò–Ω—Ñ–æ—Ä–º–∞—Ü–∏—è —Å–∫—É–¥–Ω–∞—è, —Ç–∞–º –ª–æ–∫–∞–ª—å–Ω—ã–π –∞–¥. –í –ª—é–±–æ–º —Å–ª—É—á–∞–µ —ç—Ç–æ –ø–æ–ø—ã—Ç–∫–∞ –æ—Å–ª–∞–±–∏—Ç—å –¥–∞–≤–ª–µ–Ω–∏–µ –Ω–∞ –°–µ–≤–µ—Ä–µ. –ù–µ—É–¥–∞—á–Ω–∞—è. \n \n3. –•–∞—Ä—å–∫–æ–≤—Å–∫–∏–π —É—á–∞—Å—Ç–æ–∫. –ü—Ä–æ–¥–≤–∏–Ω—É–≤—à–∏—Å—å –Ω–µ–º–Ω–æ–≥–æ –Ω–∞ –æ–¥–Ω–æ–º —É—á–∞—Å—Ç–∫–µ, –∫–æ—Ç–æ—Ä—ã–π –¥–µ—Ä–∂–∞–ª–∏ –º–æ–±–∏–∫–∏ –õ–ù–† –∏ –†–æ—Å–≥–≤–∞—Ä–¥–∏—è, –∏ –Ω–µ –¥–æ–±–∏–≤—à–∏—Å—å —Å—Ä—ã–≤–∞ —Ä–æ—Ç–∞—Ü–∏–∏ –∏ —Å–æ—Å—Ä–µ–¥–æ—Ç–æ—á–µ–Ω–∏—è –í–° –†–§, —Å–æ–±—ã—Ç–∏—è —Ç–∞–º —É—Ç–∏—Ö–ª–∏. –ò–∑-–∑–∞ –ø–æ–ª–Ω–æ–π –≤–æ–µ–Ω–Ω–æ–π –∏—Ö –±–µ—Å—Å–º—ã—Å–ª–µ–Ω–Ω–æ—Å—Ç–∏. –í–°–£ —Ä–∞–≤–Ω—è–µ—Ç –ò–∑—é–º –∏ –ø–æ–¥–±—Ä–∞—Å—ã–≤–∞–µ—Ç –ø—Ä–æ—Ç–∏–≤ –Ω–∞—Å—Ç—É–ø–∞—é—â–µ–π —Å –°–µ–≤–µ—Ä–∞ –≥—Ä—É–ø–ø–∏—Ä–æ–≤–∫–∏ –í–° –†–§ –≤—Å–µ –Ω–æ–≤—ã–µ –∏ –Ω–æ–≤—ã–µ —Å–∏–ª—ã, –∏–¥–µ—Ç –∫–ª–∞—Å—Å–∏—á–µ—Å–∫–æ–µ —Å—Ä–∞–∂–µ–Ω–∏–µ –Ω–∞ –∏–∑–º–∞—Ç—ã–≤–∞–Ω–∏–µ. –¢—è–∂–µ–ª–æ–µ –∏ –º–∞–ª–æ–ø–µ—Ä—Å–ø–µ–∫—Ç–∏–≤–Ω–æ–µ. –ü—Ä–æ—Ä–≤–∞—Ç—å —Ñ—Ä–æ–Ω—Ç –º—ã —Ç–∞–º –º–æ–∂–µ–º, –Ω–æ –∫–æ–≥–æ –≤–≤–µ—Å—Ç–∏ –≤ –ø—Ä–æ—Ä—ã–≤? –í—Å–µ –≤–æ–ø–ª–∏ –∏ –≤–∏–∑–≥–∏ –æ —Å–µ—Ç–µ—Ü–µ–Ω—Ç—Ä–∏—á–µ—Å–∫–∏—Ö –≤–æ–π–Ω–∞—Ö —Ö–æ—Ä–æ—à–∏ —Ç–æ–ª—å–∫–æ –ø–æ–∫–∞ –ª—é–±–∏—Ç–µ–ª–∏ —Ñ–∏–ª—å–º–∞ –¢–µ—Ä–º–∏–Ω–∞—Ç–æ—Ä –Ω–µ —Å—Ç–∞–ª–∫–∏–≤–∞—é—Ç—Å—è —Å –ø—Ä–æ—Å—Ç–æ–π –∏—Å—Ç–∏–Ω–æ–π - –Ω—É–∂–Ω–∞ –º–∞—Å—Å–∞. –î—Ä–æ–Ω—ã –∏ —Å—Ç–∞—Ä–ª–∏–Ω–∫–∏ —Ç–µ—Ä—Ä–∏—Ç–æ—Ä–∏—é –∑–∞—Ö–≤–∞—Ç–∏—Ç—å –∏ –∫–æ–Ω—Ç—Ä–æ–ª–∏—Ä–æ–≤–∞—Ç—å –Ω–µ –º–æ–≥—É—Ç, –∑–∞—á–∏—Å—Ç–∫–∏ –Ω–µ –ø—Ä–æ–≤–µ–¥—É—Ç. –í —ç—Ç–æ–º —Å–º—ã—Å–ª–µ –º–æ–±–∏–∫–∏ –î–õ–ù–† –¥–∞—é—Ç –≥–æ—Ä–∞–∑–¥–æ –±–æ–ª—å—à–µ —á–µ–º –∫—É—á–∞ –≤—ã—Å–æ–∫–æ—Ç–µ—Ö–Ω–æ–ª–æ–≥–∏—á–µ—Å–∫–æ–≥–æ –∂–µ–ª–µ–∑–∞. –ë–µ–∑ –Ω–µ–≥–æ –Ω–∏–∫–∞–∫, –Ω–æ –∫–∞–∫ –ø–∏—Å–∞–ª –º–æ–π –ª—é–±–∏–º—ã–π –∞–≤—Ç–æ—Ä –æ –≤–æ–π–Ω–µ —Ç–æ–π, –Ω—É–∂–Ω–∞ –ø–µ—Ö–æ—Ç–∞, –º–Ω–æ–≥–æ –ø–µ—Ö–æ—Ç—ã. \n \n4. –£—á–∞—Å—Ç–æ–∫ –ü–æ–≥—Ä–∞–Ω–∏—á—å—è. –ü—Ä–æ—Ç–∏–≤–Ω–∏–∫ –ø—Ä–∏—Ç–∏—Ö (—Ç—å—Ö—É-—Ç—å—Ö—É). –ü–æ —Ç–æ–º—É —á—Ç–æ —è –∑–Ω–∞—é - –í–ö–° –∏ –∞—Ä—Ç–∏–ª–ª–µ—Ä–∏—è –í–° –†–§ –Ω–∞—á–∞–ª–∞ —Ä–∞–±–æ—Ç–∞—Ç—å –ø–æ –º–∞–ª–µ–π—à–∏–º —Å–∫–æ–ø–ª–µ–Ω–∏—è–º –∂–∏–≤–æ–π —Å–∏–ª—ã —Å —Ç–æ–π —Å—Ç–æ—Ä–æ–Ω—ã, –∞ –∑–∞—Ä–∞–Ω–µ–µ –ø—Ä–æ–ø–ª–∞—á–µ–Ω–Ω—ã–µ –≤ –≥–æ—Ä–æ–¥–∞—Ö –∑–∞–∫–æ–Ω—á–∏–ª–∏—Å—å, —Å–ø–∞—Å–∏–±–æ —á–µ–∫–∏—Å—Ç–∞–º –∑–∞ –∏—Ö —Ç—Ä—É–¥, –Ω–µ–∑–∞–º–µ—Ç–Ω—ã–π –Ω–æ –≤–∞–∂–Ω—ã–π. –ö–æ–Ω–µ—á–Ω–æ –µ—â—ë –±—É–¥–µ—Ç, –æ—Ç —Ñ–µ–π–∫–æ–≤—ã—Ö –º–∏–Ω–∏—Ä–æ–≤–∞–Ω–∏–π –∏ –¥–æ –ø–æ–ø—ã—Ç–æ–∫ –∞—Ä—Ç–Ω–∞–ª–µ—Ç–æ–≤ –∏ —Ä–µ–π–¥–æ–≤ –î–†–ì, –Ω–æ...–ì–ª—É—Ö–æ–≤ –Ω–∞ –°—É–º—â–∏–Ω–µ —Å–æ–≤—Ä–∞—Ç—å –Ω–µ –¥–∞—Å—Ç, —ç—Ç–æ –±—ã–≤–∞–µ—Ç –±–æ–ª—å–Ω–æ. \n \n5. –Æ–≥–∞. –í—ã—Å–æ–∫–∞—è –æ–≥–Ω–µ–≤–∞—è –∏–Ω—Ç–µ–Ω—Å–∏–≤–Ω–æ—Å—Ç—å –∏ –≤—Å–µ. –ë–µ–∑ –∏–∑–º–µ–Ω–µ–Ω–∏–π. –°—Ç–æ—Ä–æ–Ω—ã –±–∞–ª—É—é—Ç—Å—è —Ä–∞–∫–µ—Ç–Ω—ã–º–∏ —É–¥–∞—Ä–∞–º–∏ –∏ –∞—Ä—Ç–Ω–∞–ª–µ—Ç–∞–º–∏ –Ω–∞ –ø–æ–∑–∏—Ü–∏–∏ –¥—Ä—É–≥ –¥—Ä—É–≥–∞. –ñ–µ—Å—Ç–∫–æ –ø–æ–ª—É—á–∞–µ—Ç –ù–∏–∫–æ–ª–∞–µ–≤, —Å—Ç–∞–≤—à–∏–π —Ç—ã–ª–æ–≤–æ–π –±–∞–∑–æ–π –ø—Ä–æ—Ç–∏–≤–Ω–∏–∫–∞. \n \n6. –ü–µ—Ä—Å–ø–µ–∫—Ç–∏–≤—ã. –° —É—á–µ—Ç–æ–º –∑–∞–¥–µ–π—Å—Ç–≤–æ–≤–∞–Ω–Ω—ã—Ö —Å–∏–ª —Ä–µ–∑–µ—Ä–≤—ã –µ—Å—Ç—å. –ì–¥–µ –∏—Ö –ø—Ä–∏–º–µ–Ω—è—Ç –∏ –ø—Ä–∏–º–µ–Ω—è—Ç –ª–∏ - –±–æ–ª—å—à–æ–π –≤–æ–ø—Ä–æ—Å. –ü–æ–∫–∞ –≤—Å–µ –∏–¥–µ—Ç –∫ —Ç–æ–º—É —á—Ç–æ –ø—Ä–æ—Ç–∏–≤–Ω–∏–∫–∞ –±—É–¥—É—Ç –≤—ã—Ç–µ—Å–Ω—è—Ç—å –∏ –ø–æ –º–µ–ª–æ—á–∏ –æ–∫—Ä—É–∂–∞—Ç—å –≤ –î–õ–ù–† –∏ —É–¥–µ—Ä–∂–∏–≤–∞—Ç—å –¥—Ä—É–≥–æ–µ. –û—Å—Ç–∞–ª—å–Ω–æ–µ –ø–æ–¥ –≤–æ–ø—Ä–æ—Å–æ–º. –ë—É–¥–µ–º –≤–∏–¥–µ—Ç—å –∏ –±—É–¥–µ–º —Å–ª—ã—à–∞—Ç—å, –∫—É–¥–∞ –º—ã –¥–µ–Ω–µ–º—Å—è. –ü–æ–∫–∞ —è—Å–Ω–æ —á—Ç–æ –ø—Ä–æ—Ç–∏–≤–Ω–∏–∫ –ø—ã—Ç–∞–µ—Ç—Å—è —Ä–∞–∑–¥–µ—Ä–≥–∞—Ç—å –Ω–∞—à–∏ —Å–∏–ª—ã –∏ –¥–æ–±–∏—Ç—å—Å—è –≤–≤–æ–¥ –≤ –±–æ–π —Ä–µ–∑–µ—Ä–≤–æ–≤, –∞ –º—ã - –≤–µ—Å—Ç–∏ –æ–±–æ—Ä–æ–Ω–∏—Ç–µ–ª—å–Ω—ã–µ –¥–µ–π—Å—Ç–≤–∏—è –Ω–∞ –±–æ–ª—å—à–∏–Ω—Å—Ç–≤–µ —É—á–∞—Å—Ç–∫–æ–≤ –±–µ–∑ –≤—Ç—è–≥–∏–≤–∞–Ω–∏—è –¥–æ–ø–æ–ª–Ω–∏—Ç–µ–ª—å–Ω—ã—Ö —Å–∏–ª. \n \nhttps://donrf.livejournal.com/1187667.html",
